        <Pet name="Ricky" animal="Dog" breed="GSD" />
        <Pet name="Katrina" animal="Dog" breed="GSD" />
        <Pet name="Tango" animal="Dog" breed="Golden Retreiver" />
      </div>
      )
  }
}

